    return (
    <article className="g-col-12  border rounded shadow">
    <div>
        <h3 className="text-center">{section.title}</h3>
        <img src="" alt="" />
        <div className="d-flex justify-content-center">
            <div>
                <button className="btn btn-primary">Learn More</button>
            </div>
        </div>
    </div>
    </article>
    );
};

export default Card;
